with the Amazon FSx file system.

=head1 ATTRIBUTES


=head2 IpAddresses => ArrayRef[Str|Undef]

A list of gateway IP addresses on which the associated Amazon FSx file
system is available.

If multiple file systems are associated with this gateway, this field
is required.



